import React from 'react';

const Header = () => {
    return (
        <header className="w-full bg-black text-white font-mono text-2xl font-bold px-10 py-4 border-b-4 border-white shadow-[0_0_15px_rgba(0,255,255,0.5)]">
            <div className="text-white text-3xl tracking-wide select-none">
                MONTREAL YOUTH VOLLEYBALL CLUB
            </div>
        </header>
    );
};

export default Header;
